function raiseWeight(inputObj, weight){
  for (var name in inputObj) {
    if (inputObj.hasOwnProperty(name)) {
      // console.log('this is fog (' + name + ') for sure. Value: ' + MARG_LAST_SEASON_WEEKDAY[name]);
      var subObj = inputObj[name];
      for (var name in subObj) {
        // console.log('this is property (' + name + ') for sure. Value: ' + subObj[name]);
        subObj[name] = subObj[name]* weight;
      }
    }
    else {
      console.log(name); // toString or something else
    }
  }
  return inputObj;
}

